def _convert_stage(stage_info: dict) -> Optional[Stage]:
    if not (filter_clause := _extract_filter_clause(stage_info)):
        return None

    clauses = []
    for i, c in enumerate(filter_clause.clauses):
        if isinstance(c, InvertedClause):
            _lgr.debug(f"skipping optimization for inverted clause '{c}'")
            continue
        if _clause_uses_field_names(c, [_AGENT_HOSTNAME]) and (list_clause := _create_list_clause(c)):
            clauses.append((i, list_clause))

    if not clauses:
        _lgr.debug("not found suitable clauses for optimization")
        return None

    for i, clause in clauses:
        filter_clause.clauses[i] = clause

    return generate_xql_filter_stage(filter_clause.to_dict())

