def _extract_filter_clause(stage_info: dict) -> Optional[BooleanClauseList]:
    filter_clause = FilterClause.from_dict(stage_info)
    if not isinstance(filter_clause, BooleanClauseList):
        return None

    # If `agent_id` in any form (e.g. EQ, IN, NIN, etc.) is already present in the filter, we skip optimization.
    if _clause_uses_field_names(filter_clause, [_AGENT_ID, _AGENT_ID_HIDDEN]):
        _lgr.debug(f"FILTER stage already contains either '{_AGENT_ID}' or '{_AGENT_ID_HIDDEN}' - skipping optimization")
        return None

    return filter_clause

