def _fetch_agent_ids(clause: BooleanClause) -> Dict[str, List[str]]:
    agent_id, host_name = AgentColumns.AGENT_ID.value, AgentColumns.HOSTNAME.value
    svc = AgentsService(TENANT_CONTEXT)
    fo = _create_filter_object(clause)
    max_names = fo.query_params.limit-1
    results: List[dict] = svc.get_agents(TENANT_CONTEXT, fo, [agent_id, host_name], return_dict=True)

    if len(results) == 0:
        _lgr.debug(f"skipping optimization because AgentsService produced no results for clause '{clause}' ")
        return {}

    if len(results) > max_names:
        _lgr.debug(f"skipping optimization due to number of ids exceeding predefined max={max_names}")
        return {}

    ids = defaultdict(list)
    # re-arrange the result to have host_name as keys and list of associated ids as values.
    for row in results:
        ids[row[host_name]].append(row[agent_id])

    return ids

