def _is_event_type_referenced(stages) -> bool:
    for stage in stages:
        _, stage_name, stage_info = _extract_stage_artifacts(stage)
        if not stage_name == XQLStagesConsts.FILTER:
            continue

        filter_clause = FilterClause.from_dict(stage_info)
        if not isinstance(filter_clause, BooleanClauseList):
            continue

        if _clause_uses_field_names(filter_clause, [_EVENT_TYPE, _EVENT_TYPE_HIDDEN]):
            _lgr.debug(f"found FILTER stage referencing `{_EVENT_TYPE}` or `{_EVENT_TYPE_HIDDEN}`")
            return True

    return False

