def generate_view(context: Dict, input_dict: Dict, xql_json: Dict):
    lgr.debug(f"Got the following params to work with input_dict={input_dict} xql={xql_json}")
    context = parse_context(context)
    child_tenant = ChildTenantXqlActions(context)

    try:
        view_name, _ = child_tenant.generate_view(input_dict, xql_json=xql_json)
        return BaseResponse(context=context, data=view_name)
    except XqlParserException as e:
        lgr.exception(f"XQL parsing failed: {e}")
        return BaseError(context=context, err=XqlErrors.XqlParserError(error_data=e.to_dict()))
    except XqlYearlyQuotaExceededException as xqe:
        lgr.exception(f"Yearly quota exceeded {xqe}")
        err = XqlErrors.XqlYearlyQuotaExceeded(extra=xqe.to_dict())
        return BaseError(context=context, err=err)
    except XqlQuotaExceededException as xqe:
        lgr.exception(f"Quota exceeded {xqe}")
        err = XqlErrors.XqlQuotaExceeded(extra=xqe.to_dict())
        return BaseError(context=context, err=err)
    except Exception as e:
        lgr.exception(f"Got exception during generate_view request, {e}")
        return BaseError(context=context, err=XqlErrors.XqlGeneralError(error_msg="Error occurred, check child logs"))

