def alert_field_enums():
    from secdo.business_logic.alerts.alert_mappings import alert_fields as alert_fields
    from secdo.core.secdo_objects.alert_xdr_field import get_enum_values_from_field, get_pretty_name_string
    from secdo.core.utils.structs import NumericConstantDict

    enum_dict = {}
    enum_fields = [field_obj for field_name, field_obj in alert_fields.items() if
                   field_obj.ui_data_type == DataTypes.ENUM and
                   not field_obj.is_list_col and
                   (field_obj.is_to_public or field_name in UI_FIELDS)]

    for enum_field in enum_fields:
        current_enum_dict = {}
        current_enum_values = get_enum_values_from_field(enum_field)

        for value in current_enum_values:
            if issubclass(type(enum_field.ui_enum_values), NumericConstantDict):
                current_ui_value = enum_field.ui_enum_values.get_name_from_value(value)
            elif enum_field.ui_data_type == DataTypes.DYNAMIC_ENUM:
                current_ui_value = value['PRETTY_NAME']
                value = value['NAME']
            else:
                current_ui_value = getattr(enum_field.ui_enum_values, value)

            display_value = get_display_value(current_ui_value)

            current_enum_dict[display_value] = {
                "value": value,
                "display": display_value
            }

        if len(current_enum_dict) > 0:
            enum_dict[format_string_for_xql(get_pretty_name_string(enum_field)).lower()] = current_enum_dict

    # CRTX-96443 - Setting host_os N_A to NO_HOST to handle XQL's bug with duplicate enum display names
    agent_os_type_field = alert_fields.get(AlertFields.AGENT_OS_TYPE.value)
    agent_os_field_name = format_string_for_xql(get_pretty_name_string(agent_os_type_field)).lower()

    enum_dict[agent_os_field_name]['NO_HOST'] = {DISPLAY: 'NO_HOST',
                                                 VALUE: 'NO_HOST'}
    enum_dict[agent_os_field_name].pop('N_A', None)

    # Remove informational and unkown severities, since they are not relevant for the clients
    enum_dict[AlertFields.SEVERITY.value].pop(format_string_for_xql(SeverityEnum.SEV_010_INFO.value.default_text), None)
    enum_dict[AlertFields.SEVERITY.value].pop(format_string_for_xql(SeverityEnum.SEV_090_UNKNOWN.value.default_text),
                                              None)

    # specific handle for resolution_status
    enum_dict[AlertFields.RESOLUTION_STATUS.value] = get_alert_statuses_enum()
    return enum_dict

