def _resolve_enum_display(value: dict, dataset_enums: dict) -> str:
    dependency = value.get("dependency", {})
    field = dependency.get("field", None)
    if field is None:
        return value.get("display")

    ref_enum = dataset_enums.get(field, {}).get(dependency.get("ref"))
    if ref_enum is None:
        return value.get("display")
    # support recursive ref (depth >= 2)
    return f'{_resolve_enum_display(ref_enum, dataset_enums)}_{value.get("display")}'

