def _search_enum_and_consts(display_value: str, prefix: str, callback, fields: Set[str] = None, datasets: set = None):
    """
    :param display_value: the enum value to translate i.e. FILE
    :param fields: collection of known fields for backward compatibility for enums usage
    :return: enum value, or original enum_display
    """
    raise_error = False
    error = f"Unable to find value for {display_value}"
    try:
        if display_value is None:
            return display_value
        if display_value.startswith("$`") and display_value.endswith("`"):
            return display_value
        display_value_ci = display_value.casefold()
        if display_value_ci.startswith(f"${prefix}"):
            display_value = display_value_ci.replace(f"${prefix}", "$")
            raise_error = True
        else:
            fields = fields or {}
            fields = {f.casefold() for f in fields}
            if display_value_ci.replace('$', '') in fields:
                return display_value
        cb_val = callback(display_value, datasets)
        if cb_val is not None:
            return cb_val
        if raise_error:
            raise ValueError(error)
        return display_value
    except:
        lgr.warning(error, exc_info=1)
        if raise_error:
            raise
        return display_value

