def enum_display_to_enum_value_single_row(row: dict, field: str, value):
    """
    Converts enum display value (string, i.e. "START") to it's enum value (numeric, i.e. 1)
    :param row:
    :param field:
    :param value:
    :return: the enum value
    """
    def _impl(row: dict, field: str, value):
        for dataset_name, dataset_enums in get_enums().get(_DATASETS, {}).items():
            for dataset_field, enum_values in dataset_enums.items():
                if dataset_field.lower() == field.lower():
                    for enum_name, enum_value in enum_values.items():
                        if str(value) in [enum_value.get("display"), str(enum_value.get("value")), str(enum_value.get(DEPRECATED_NAME, ""))]:
                            val = enum_value.get("value")
                            if field in ["action_country", "dst_action_country"] and val == "-":
                                val = "UNKNOWN"
                            dependency = enum_value.get("dependency", {})
                            ref_field = dependency.get("field")
                            if ref_field is not None:
                                for k,v in row.items():
                                    if k.lower() == ref_field.lower():
                                        ref_enum_name, _ = _impl(row,k,v)
                                        if ref_enum_name == dependency.get("ref"):
                                            return enum_name, val
                            else:
                                return enum_name, val
        return None, value

    _, val = _impl(row, field, value)
    return val

