def generate_custom_tuples(values: list):
    """
    This function gets a list of values and creates a ConstantDict of {val: val}.
    It's used to fill the xql query results filter box with unknown values
    :param values:
    :return: { val1: val1, val2: val2 ..}
    """
    class TempConstantDict(ConstantDict):
        pass
    class TempNumericConstantDict(NumericConstantDict):
        pass

    the_dict = defaultdict(list)
    constant_dict_type = TempConstantDict
    if values and isinstance(values[0], int):
        constant_dict_type = TempNumericConstantDict
    for val in values:
        if isinstance(val, int):
            the_dict[val].append(val)
        else:
            the_dict[f"{val}"].append(val)

    if not the_dict:
        return None

    constant_dict_type = constant_dict_type(constant_dict_type.from_dict(the_dict))
    return BaseColumnDef.convert_enum_tuples_to_display_dict(list(constant_dict_type.get_tuples()))

