def generate_enum_dict(field: str, datasets: set = None) -> (dict, str):
    """
    Returns a dict of field value as key and display value as dict value
    :param field: enum field name
    :return: dict of values -> display value. event_sub_type builds an internal dict because it's correlated with event type
    """
    enum_dict = {}
    ref_field = None
    enums = get_enums().get(_DATASETS, {})
    if not datasets:
        datasets = enums.keys()
    for dataset in datasets:
        dataset_enums = enums.get(dataset)
        if not dataset_enums:
            continue
        dataset_enums = dicti(dataset_enums)
        enum_values = dataset_enums.get(field.lower())
        if not enum_values:
            break
        for enum_value in enum_values.values():
            dependency = enum_value.get("dependency", {})
            ref_field = dependency.get("field", None)
            value_field = enum_value.get("value")
            if ref_field is None:
                enum_dict[value_field] = enum_value.get("display")
            else:
                ref_enum = dataset_enums.get(ref_field, {}).get(dependency.get("ref"))
                if not ref_enum:
                    continue
                sub_type = enum_dict.get(enum_value.get("value"), {})
                sub_type[ref_enum.get("value")] = f'{ref_enum.get("display")}_{enum_value.get("display")}'
                enum_dict[value_field] = sub_type
    return enum_dict, ref_field

