def generate_enum_tuples(enum_field: str, datasets: set = None) -> list:
    """
    :param enum_field: the enum field i.e. event_type
    :param datasets:
    :return: returns tuples of value, display
    """
    class TempConstantDict(ConstantDict):
        pass

    if enum_field is None:
        return None
    the_dict = defaultdict(list)
    obj = TempConstantDict
    seen_values = set()
    try:
        enums = get_enums().get(_DATASETS, {})
        if not datasets:
            datasets = enums.keys()
        for dataset in datasets:
            dataset_enums = enums.get(dataset)
            if not dataset_enums:
                continue
            for dataset_field, enum_values in dataset_enums.items():
                if dataset_field.lower() == enum_field.lower():
                    for enum_value in enum_values.values():
                        dependency = enum_value.get(DEPENDENCY, {})
                        field = dependency.get(FIELD, None)
                        if field is None:
                            display_value = enum_value.get(DISPLAY)
                            if display_value not in seen_values:
                                the_dict[display_value].append(display_value)
                                seen_values.add(display_value)
                        else:
                            ref_enum = dataset_enums.get(field, {}).get(dependency.get(REF))
                            display_value = f'{ref_enum.get(DISPLAY)}_{enum_value.get(DISPLAY)}'
                            if display_value not in seen_values:
                                the_dict[display_value].append(display_value)
                                seen_values.add(display_value)
        if not the_dict:
            return None
        return obj(obj.from_dict(the_dict))
    except ImportError:
        raise
    except Exception:
        lgr.warning("error building tuples for %s", enum_field, exc_info=1)

