def search_enum(enum_display_value: str, fields: Set[str] = None, datasets: set = None):
    enums = get_enums().get(_DATASETS, {})

    def _call_back(display_value, query_datasets: set):
        value = display_value.replace("$", "").lower()
        if not query_datasets:
            query_datasets = enums.keys()
        for dataset in query_datasets:
            dataset_enums = enums.get(dataset)
            if not dataset_enums:
                continue
            for dataset_field, enum_values in dataset_enums.items():
                for enum_value in enum_values.values():
                    dependency = enum_value.get("dependency", {})
                    ref = dependency.get("ref", None)
                    if ref is not None:
                        ref_enum = dataset_enums.get(dependency.get("field", {})).get(dependency.get("ref"))
                        if ref_enum is None:
                            continue
                        if f'{ref_enum.get("display")}_{enum_value.get("display")}'.lower() == value:
                            return enum_value.get("value")
                    elif value in [enum_value.get("display").lower(), enum_value.get(DEPRECATED_NAME, "").lower()]:  # for support of deprecated non ref enums
                        return enum_value.get("value")
        return None
    return _search_enum_and_consts(enum_display_value, _ENUM_PREFIX, _call_back, fields, datasets)

