def set_enum_displays_on_dicts(rows: List[Dict], datasets: set = None):
    UNKNOWN_VAL = 'UNKNOWN'

    if not rows:
        return rows

    if config.CorrelationsRulesConf.use_all_events_fields_to_gather_enum_enrich_schema:
        fields = set()
        for row in rows:
            fields.update(row.keys())
    else:
        fields = rows[0].keys()

    enum_dicts = {field: generate_enum_dict(field, datasets) for field in fields}

    for row in rows:
        row_snapshot_before = copy(row)
        for field in row:
            enum_values, dependency_field = enum_dicts[field]
            if not enum_values:
                continue

            if dependency_field and dependency_field not in row:
                row[field] = UNKNOWN_VAL
                continue

            field_value = row[field]
            if field_value not in enum_values:
                row[field] = None if field_value is None else UNKNOWN_VAL
                continue

            enum_result = enum_values[field_value]

            if dependency_field is not None:
                dependency_field_value = row_snapshot_before[dependency_field]
                enum_result = enum_result.get(dependency_field_value, UNKNOWN_VAL)

            row[field] = enum_result

