def add_filter_optimization(xql_obj: Union[XQLObject, dict]):
    _conf = config.GCPConf
    if not (_conf.bq_use_filter_optimization or _conf.bq_use_event_sub_type_optimization):
        return

    stages, tables = _extract_obj_artifacts(xql_obj)
    if stages is None:
        return

    copied_stages = stages[:]
    new_stages_counter = 0
    for i, stage in enumerate(copied_stages):
        is_dict, stage_name, stage_info = _extract_stage_artifacts(stage)

        # Solving CRTX-112829. Once we use ALTER, we cannot optimize anymore.
        if stage_name == XQLStagesConsts.ADD_FIELDS:
            break

        if stage_name != XQLStagesConsts.FILTER:
            continue

        matched_optimization_field_values = set()
        if _conf.bq_use_filter_optimization:
            optimization = XqlFieldsOptimization(stage_info, _conf.bq_use_event_sub_type_optimization)
            matched_optimization_field_values = optimization.handle_filter_conditions_optimization()
        if _conf.bq_use_event_sub_type_optimization:
            optimization = EventSubTypeOptimization(stage_info, _conf.bq_use_filter_optimization)
            matched_optimization_field_values.update(optimization.handle_filter_conditions_optimization())
        matched_optimization_field_values.discard(SHOULD_BE_FILTER)

        conditions = []
        if len(matched_optimization_field_values) == 1:
            conditions.append(
                generate_xql_field_condition(EVENT_TYPE_SYSTEM_FIELD, SearchOperators.EQ,
                                             matched_optimization_field_values.pop()))

        elif len(matched_optimization_field_values) > 1:
            conditions.append(
                generate_xql_field_condition(EVENT_TYPE_SYSTEM_FIELD, SearchOperators.IN,
                                             list(matched_optimization_field_values)))

        if len(conditions) > 0:
            cond = generate_xql_simple_filter_stage(conditions)
            if is_dict:
                cond = cond.to_dict()
            stages.insert(i + new_stages_counter, cond)
            new_stages_counter += 1

