def _validate_lookup(lookup: str):
    forbidden_lookups = ujson.loads(config.XqlIngestionConf.user_forbiden_lookups)
    if lookup.casefold() in forbidden_lookups:
        return False, None, None

    svc = DatasetManagementService(TENANT_CONTEXT)
