    if res.dataset_type.value != XQLDataSetType.LOOKUP:
        return True, False, None

    if config.XqlIngestionConf.validate_lookup_size:
        LookupService(TENANT_CONTEXT).verify_lookup_size_from_bq(lookup, ui_error=True)

