def fix_enums_in_schemas(schemas: dict, field_iter: typing.Callable):
    """
    Adds enum source for every enum column in each schema if global configuration enables enums translation.
    :param schemas: dict object with keys containing table names and values containing schema for that table.
    :param field_iter: Function that given a schema from the schemas dict returns iterator for schema fields.
    """
    if not _xql_sql_enum_conversion:
        return

    from secdo.core.xql.file_based_content.field_enums.field_enums import get_dynamic_enums
    from secdo.core.xql.file_based_content.field_enums.field_enums_content import get_enums

    def fix_field(t: str, f: str) -> str:
        # fixes the name of the field in case of mapping field name, e.g. 'xdr_data.event_type' -> 'event_type'
        if f.startswith(f"{t}."):
            return f[len(t) + 1:]
        return f

    enums = get_enums()["datasets"]
    for table, s in schemas.items():
        table = _strip_xdm_view_prefix_from_table_name(table)
        if table_enums := enums.get(table) or get_dynamic_enums(table):
            for field, pz_type in field_iter(s):
                field = fix_field(table, field)
                if field_enums := table_enums.get(field):
                    pz_type.enum_def = EnumDefinition(table, field, field_enums)

