def _parse_offset(offset: str, execution_time, convert_to_secs: bool) -> int:
    convert_factor = 1 if convert_to_secs else 1000
    if execution_time is not None:
        current_time = datetime.fromtimestamp(execution_time / 1000)
    else:
        current_time = datetime.now()
    if offset == XqlBetweenOpConsts.NOW:
        return round(mktime(current_time.timetuple()) * convert_factor)
    if offset == XqlBetweenOpConsts.BEGIN:
        return 0
    default_shift_time_past = True
    if offset[0] in ["-", "+"]:
        if offset[0] == "+":
            default_shift_time_past = False
        offset = offset[1:]
    shift_value = re.findall(r'\d+', offset)
    if len(shift_value) > 1:
        raise ValueError(f"Invalid format for timeframe: more than 1 int for time offset {offset}")
    # if no offset number - set to 1 by default
    shift_value = int(shift_value[0]) if shift_value else 1
    time_unit = re.findall(r'\D+', offset)
    if len(time_unit) < 1:
        raise ValueError(f"Invalid format for timeframe: couldn't find time unit fot time offset {offset}")
    time_unit = time_unit[0].casefold()
    if time_unit not in RELATIVE_TIME_DICT:
        raise ValueError(f"Invalid format for timeframe: time unit {time_unit} is not valid")
    if default_shift_time_past:
        return round(mktime(RELATIVE_TIME_DICT[time_unit](current_time, shift_value).timetuple()) * convert_factor)
    return round(mktime(RELATIVE_TIME_DICT_FUTURE[time_unit](current_time, shift_value).timetuple()) * convert_factor)

