def parse_timeframe(timeframe: dict, execution_time=None, convert_to_secs=False) -> list:
    """
    Convert timeframe from: {'relativeTime': <num>} or {'from': <num> | string, 'to': <num> | string}
        (all nums are in milliseconds)
    to: [<from_num>, <to_num>].
    If convert_to_secs=True then the result is in seconds. otherwise in milliseconds.
    """
    if not isinstance(timeframe, dict):
        raise ValueError(f"Timeframe must be of type dict, got {type(timeframe)}")

    if isinstance(timeframe.get(XqlBetweenOpConsts.FROM), str) and \
            isinstance(timeframe.get(XqlBetweenOpConsts.TO), str):
        from_time = _parse_offset(timeframe.get(XqlBetweenOpConsts.FROM).casefold(), execution_time, convert_to_secs)
        to_time = _parse_offset(timeframe.get(XqlBetweenOpConsts.TO).casefold(), execution_time, convert_to_secs)
        if from_time > to_time:
            raise XqlTtimeframeValidationException(GenericErrors.XqlTimeframeValueError,
                                                   S.errors.XQL_TIMEFRAME_VALUE_FROM_DATE_ERROR())

        return [from_time, to_time]

    convert_factor = 1000 if convert_to_secs else 1
    if execution_time is not None:
        time_now = int(execution_time / convert_factor)
    else:
        time_now = generate_current_epoch_utc(seconds=convert_to_secs)
    if timeframe.get(XqlTimeframeConsts.RELATIVE_TIME) is not None:
        return [time_now - int(timeframe.get(XqlTimeframeConsts.RELATIVE_TIME) / convert_factor), time_now]
    elif timeframe.get(XqlBetweenOpConsts.FROM) is not None and timeframe.get(XqlBetweenOpConsts.TO) is not None:
        return [int(timeframe.get(XqlBetweenOpConsts.FROM) / convert_factor),
                int(timeframe.get(XqlBetweenOpConsts.TO) / convert_factor)]
    else:
        raise ValueError("Invalid format for timeframe, expected {'relativeTime': <num>} or " +
                         "{'from': <num> | <str>, 'to': <num> | <str>}, got: " + str(timeframe))

