def _visit_xql(ctx: xql_grammarParser.XqlContext):
    """
    Takes XQL context of a parsing tree and produces a string with sensitive data anonymized
    """
    tokens = []

    def visit_children(ctx_):
        nonlocal tokens
        if hasattr(ctx_, 'children') and ctx_.children is not None and len(ctx_.children) > 0:
            for c in ctx_.children:
                visit_children(c)
        else:
            if hasattr(ctx_, 'symbol'):
                text = _ENC_MAP.get(ctx_.symbol.type, lambda _: _)(ctx_.getText())
                tokens.append(f"{text} ")

    visit_children(ctx)
    return "".join(tokens)

