def _filter_xdm_dict_keys_fn(table_name: str, fields_to_keep: Set[str], schema: dict[str, PzFieldType]) -> Callable[[Mapping[str, Any]], Mapping[str, Any]]:
    def _keep_field(key: str) -> bool:
        field = key.casefold()

        if field in fields_to_keep:
            return True

        # This check might be redundant and be removed in the future, see CRTX-73412
        if field.startswith(XQLNamespaces.XDM) or get_dataset_and_field_from_xdm_dataset_field(full_field_name=field, table=table_name):
            return False

        return not (field in schema and schema[field].family == FieldFamily.USER)  # not custom (user) field

    def _fn(dictionary: Mapping[str, Any]) -> Mapping[str, Any]:
        """ Filters away XDM fields and raw access fields (such as xdr_data.event_type) that do not appear in `fields_to_keep`, returning a dicti. """
        return dicti({key: value for key, value in dictionary.items() if _keep_field(key)})

    return _fn

