def convert_getrole_stage_to_sql(helper, stage: dict, metadata: HelperMetadata) -> (QueryPartsDict, bool):
    field = stage[_GS.FIELD]
    alias = stage.get(_GS.AS) or GETROLE_XQL_STAGE_DEFAULT_COLUMN_NAME
    entity_id = f"entity_{uuid.uuid4().hex}"
    ds = XQLConsts.Dataset.PREDEFINED_ROLES_DATASET
    try:
        if not is_identity_threat_and_identity_module_enabled():    # return empty array when ITDR module is not active
            alter_stage = generate_xql_alter_stage([generate_xql_alter_field(field_name=alias, field_source=_empty_string_array())])
            qry_parts, is_separated = helper.execute_stage(Stage.from_dict(alter_stage), metadata)
        else:
            join_stage = {
                XQLStagesConsts.JOIN: {
                    XQLConsts.JoinStage.JOIN_WITH: {
                        XQLConsts.TABLE_NAMES: [ds],
                        XQLConsts.STAGES: [
                            {
                                XQLStagesConsts.FIELD_SELECT: {
                                    XQLConsts.FieldSelect.FIELDS: [
                                        {_NAME: GETROLE_XQL_STAGE_DEFAULT_COLUMN_NAME, _AS: alias},
                                        {_NAME: _GS.ENTITY_ID, _AS: entity_id}
                                    ],
                                    XQLConsts.FieldSelect.EXCLUDE: []
                                }
                            }
                        ],
                    },
                    XQLConsts.JoinStage.RENAMED_DATASET: ds,
                    XQLConsts.JoinStage.CONDITIONS: {
                        SearchMeta.FETCH_FILTER: {
                            SearchConnectors.OR: [
                                {
                                    FieldSearchExtendedConst.LEFT.value: _to_string_lower(f"${field}"),
                                    FieldSearchExtendedConst.OPERATOR.value: SearchOperators.EQ,
                                    FieldSearchExtendedConst.RIGHT.value: _to_string_lower(f"${ds}.{entity_id}"),
                                    FieldSearchConsts.FILTER_DIALECT.value: FilterDialects.EXTENDED_FILTER_OBJ.value
                                }
                            ]
                        }
                    },
                    XQLConsts.JoinStage.CONFLICT_STRATEGY: XQLConsts.JoinStage.ConflictStrategy.INNER,
                    XQLConsts.JoinStage.JOIN_STRATEGY: XQLConsts.JoinStage.JoinStrategy.LEFT
                }
            }
            metadata.schemas[ds] = XQLTableSchema(SchemaHelper.get_table_schema(ds), partition_colum=None, event_time_col=None)
            add_stage = {
                XQLStagesConsts.ADD_FIELDS: {
                    XQLConsts.AddFields.FIELDS: [
                        {
                            XQLConsts.AddFields.NAME: alias,
                            XQLConsts.AddFields.SOURCE: _coalesce_with_empty_arr(f"${alias}")
                        }
                    ]
                }
            }

            qry_parts, is_separated = helper.execute_stage(Stage.from_dict(join_stage), metadata)
            qry_parts = [
                qry_parts,
                #  return an empty array if asset_roles value is null
                helper.execute_stage(Stage.from_dict(add_stage), metadata)[0],
                # 'entity_id' is an aux field used for joining tables. It is still inside 'qry_parts'.
                # We want to exclude it from the final result.
                helper.execute_stage(generate_fields_deselect_stage([entity_id]), metadata=metadata)[0]
            ]

    except ValidationError as e:
        e.validation_type = ValidationType.Stage.value
        e.name = XQLStagesConsts.GETROLE
        raise e

    return qry_parts, is_separated

