def get_view_table_sub_stages(xql_obj: Union[XQLObject, Dict[str, Any]]) -> List:
    if isinstance(xql_obj, XQLObject):
        output_stages = filter(lambda s: s.name == XQLOutputStagesConsts.VIEW and s.info.name == XQLOutputSubStagesConsts.TABLE,xql_obj.output_stages or [])
    else:
        output_stages = filter(lambda s: s.get(XQLOutputStagesConsts.VIEW, {}).get(XQLOutputSubStagesConsts.TABLE), xql_obj.get(XQLConsts.OUTPUT_STAGES))
