def _validate_permissions(permissions, context: Context) -> bool:
    if permissions is None:
        return True
    if is_admin_role(context):
        return True
    real_perms = []

    for perm in permissions:
        real_perms.extend([real_perm for real_perm in _all_permissions() if real_perm.name == perm.name])
    if len(real_perms) == 0:
        return True
    # to be remove for check proposal
    merged_permission = reduce(lambda a, b: a | b, real_perms[1:], real_perms[0])
    if context.calling_user_permission >= merged_permission:
        return True
    return False

