def extract_permissions_from_tables(table_names: [], context,
                                    handle_wildcards: bool = True,
                                    include_deleted: bool = False,
                                    include_inactive: bool = False,
                                    dataset_mgmt=None) -> (List[str], List[XQLDataSet]):
    permissions = []
    datasets = []
    if not table_names:
        return permissions, datasets
    if handle_wildcards:
        from secdo.business_logic.xql.dataset_management.dataset_service import DatasetManagementService
        dataset_mgmt = DatasetManagementService(context)
        table_names = dataset_mgmt.handle_wildcards(table_names, include_inactive=include_inactive)
    for table in table_names:
        data_set = _get_dataset(table, context, include_inactive=include_inactive, dataset_mgmt=dataset_mgmt)
        if include_deleted and not data_set:
            data_set = _get_deleted_dataset(table, context)
        if data_set:
            datasets.append(data_set)
            if data_set.permissions and data_set.permissions.value:
                permissions.extend(data_set.permissions.value)
    return permissions, datasets

