def get_preset(name: str, with_deleted: bool = False) -> Tuple[str, XQLObject]:
    """
    Returns a preset specified by name. 
    :param name: Preset name.
    :param with_deleted: .
    :return: xql string of the preset or None if not found.
    """
    def convert(rows):
        return ((preset[_COLUMNS.PRESET_XQL],
                 XQLObject.from_dict(ujson.loads(preset[_COLUMNS.XQL_OBJECT])) if preset[_COLUMNS.XQL_OBJECT] else None)
                for preset in rows)

    init_dict = {
        SearchMeta.FETCH_FILTER: {
            SearchConnectors.AND: [
                {
                    SearchConsts.SEARCH_FIELD: XQLPresetsDBConsts.XQLPresetsTableColumns.PRESET_NAME,
                    SearchConsts.SEARCH_TYPE: SearchOperators.EQ,
                    SearchConsts.SEARCH_VALUE: name
                }
            ]
        }
    }
    filter_ = FilterObject(init_dict=init_dict)
    filter_ = filter_ & _get_filter(with_deleted)
    res = list(_get_observer(convert).fetch(filter_))
    if not res:
        raise XqlPresetNotFoundException(f"Preset {name} was not found")
    return res[0]

