def _create_field_source(field_name: str, field: PzFieldType, json_col: str) -> ScalarFuncValue:
    parameters = [f"${json_col}", f"$['{field_name}']"]
    field_type, = field.types_

    if field.is_array or field_type == FieldDType.JSON:
        if field_type in {FieldDType.NUMERIC, FieldDType.NUMERIC_FLOAT, FieldDType.BOOLEAN}:
            lgr.warning("Conversion of types list[bool / int / float] are not defined.")
        return ScalarFuncValue(function=XQLFunctionNames.JSON_EXTRACT, parameters=parameters)

    cast_func = FIELD_TYPE_TO_CAST_FUNC.get(field_type)
    json_extract_parameter = ScalarFuncValue(function=XQLFunctionNames.JSON_EXTRACT_SCALAR, parameters=parameters)
    return ScalarFuncValue(function=cast_func, parameters=[json_extract_parameter]) if cast_func else json_extract_parameter

