def _handle_config_in_query_library_call(xql_obj, q_obj_config: Config, is_object: bool = False) -> None:
    # if outer query has config, it depends on which one of them, it's config will win, and not the saved call query
    if is_object:
        xql_obj.config = xql_obj.config or Config()
        if xql_obj.config.case_sensitive is None and q_obj_config.case_sensitive is not None:
            xql_obj.config.case_sensitive = q_obj_config.case_sensitive
        if not xql_obj.config.timeframe and q_obj_config.timeframe:
            xql_obj.config.timeframe = q_obj_config.timeframe
    else:
        xql_obj[XQLConsts.CONFIG] = xql_obj.get(XQLConsts.CONFIG, {})
        xql_obj[XQLConsts.CONFIG][XqlConfigArgsConsts.CASE_SENSITIVE] = xql_obj[XQLConsts.CONFIG].get(
            XqlConfigArgsConsts.CASE_SENSITIVE, q_obj_config.case_sensitive)
        if not xql_obj[XQLConsts.CONFIG].get(XqlConfigArgsConsts.TIMEFRAME) and q_obj_config.timeframe:
            xql_obj[XQLConsts.CONFIG][XqlConfigArgsConsts.TIMEFRAME] = q_obj_config.timeframe

