def refresh_bq_enums():
    if config.GCPConf.disable_xql_bq_enums_on_epp and LicensingService().is_epp_only_license():
        lgr.info("This is an EPP only license skipping ....")
        return

    bq_dao = get_basic_bq_dao()

    # ToDo: This list may need to be updated
    skip_fields = ["tenant"]
    # skip_fields.extend(dynamic_enum_cols.keys())
    redis = RedisClient(decode_responses=True)
    redis_key = RedisKeyBuilder('xql', 'bq_enums', 'hash')
    _redis_hash = redis.get(redis_key)
    _enums = get_enums()

    _hash = "_".join([dict_hash(_enums), dict_hash(skip_fields), config.Generic.product_version])
    if config.Generic.cortex_init_bq_enums_skip_rerun and _redis_hash == _hash:
        lgr.info("BqEnums already up to date. Update will be skipped")
        return
    lgr.info(f"Bq Enums hash in redis is {_redis_hash}. Current enums hash is: {_hash} Going to run update")
    is_succeed = True
    for dataset_name, dataset in _enums["datasets"].items():
        for enum_name, enum_data in dataset.items():
            # Skipping tenants enum (handled separately)
            if enum_name in skip_fields:
                continue
            is_numeric_values = False
            if all([isinstance(x.get("value"), int) for x in enum_data.values()]):
                is_numeric_values = True

            id_type = "STRING" if enum_name in ["action_country", "dst_action_country"] or is_numeric_values is False else "NUMERIC"
            extra_column = "event_id" if enum_name == "event_sub_type" else None
            rows = []
            update_rows = {}
            enum_name = f"{dataset_name}_ds_{enum_name}" if dataset_name != 'xdr_data' else enum_name
            enum_table = bq_dao._get_table_ref(enum_name, dataset=config.GCPConf.bq_enums_dataset,
                                               project_id=config.GCPConf.project_id)
            recreate = False
            existing_enum_ids = None
            if config.TestsConf.is_secdo_init_test:
                recreate = True
            else:
                try:
                    enum_table = bq_dao.client.get_table(enum_table)
                    tb_schema = enum_table.schema
                    # get current enum values
                    job = bq_dao.client.query(f"SELECT * FROM `{config.GCPConf.bq_enums_dataset}.{enum_name}`")
                    is_failed = job.exception(timeout=None)

                    if is_failed is not None:
                        is_succeed = False
                        continue
                    curr_enum_vals = [x for x in job.result()]
                    existing_enum_ids = {(x.get("id"), x.get(extra_column)): x.get("value") for x in curr_enum_vals}
                    if len(curr_enum_vals) != len(enum_data.values()):
                        recreate = True
                        lgr.warning("recreating table %s", enum_name)
                    for f in tb_schema:

                        if f.name == "id" and ((f.field_type == "STRING" and is_numeric_values is True) or (
                                f.field_type == "NUMERIC" and is_numeric_values is False)):
                            lgr.warning("enum schema changed dropping %s", enum_table)
                            recreate = True
                            break
                    if len(enum_data.values()) == 0:
                        recreate = True  # empty, we can't tell type anymore
                except NotFound:
                    recreate = True

            if recreate is True and len(enum_data.values()) > 0:
                lgr.info(f"enum table {enum_name} not found. Creating")
                try:
                    if not config.TestsConf.is_secdo_init_test:
                        bq_dao.client.delete_table(enum_table)
                except Exception:
                    pass
                # Create missing enum table
                existing_enum_ids = None
                enum_schema = [
                    {
                        "name": "id",
                        "type": id_type,
                        "mode": "NULLABLE"
                    },
                    {
                        "name": "value",
                        "type": "STRING",
                        "mode": "NULLABLE"
                    }
                ]
                if extra_column is not None:
                    enum_schema.append(
                        {
                            "name": extra_column,
                            "type": id_type,
                            "mode": "NULLABLE"
                        }
                    )

                dataset_ref = bigquery.DatasetReference(project=config.GCPConf.project_id,
                                                        dataset_id=config.GCPConf.bq_enums_dataset)
                table_ref = dataset_ref.table(table_id=enum_name)
                table = bigquery.Table(table_ref, schema=enum_schema)
                bq_dao.client.create_table(table)
                lgr.info(f"enum table {enum_name} created")

            # get current enum values
            if existing_enum_ids is None:
                job = bq_dao.client.query(f"SELECT * FROM `{config.GCPConf.bq_enums_dataset}.{enum_name}`")
                is_failed = job.exception(timeout=None)

                if is_failed is not None:
                    is_succeed = False
                    continue

                curr_enum_vals = job.result()
                existing_enum_ids = {(x.get("id"), x.get(extra_column)): x.get("value") for x in curr_enum_vals}

            for enum_value in enum_data.values():
                extra_value = None

                display_value = enum_value.get('display')

                if extra_column is not None:
                    dep = enum_value.get("dependency")
                    dep_field = dep.get("field")
                    dep_value = dep.get("ref").upper()
                    extra_value = get_enums()['datasets']['xdr_data'][dep_field][dep_value]['value']
                    display_value = dep_value + '_' + display_value

                curr_enum_id = enum_value.get('value')

                # Fixing bug where enums file contained event_type LOAD_IMAGE (6), sub type PRELOAD as type 2 instead of 3 (XDR-29898)
                if enum_name == "event_sub_type" and (curr_enum_id, extra_value) == (2, 6) and existing_enum_ids.get((curr_enum_id, extra_value)) in (
                'PRELOAD', 'LOAD_IMAGE_PRELOAD'):
                    existing_enum_ids.pop((curr_enum_id, extra_value), None)
                    query_job = bq_dao.client.query(
                        f"DELETE FROM {config.GCPConf.bq_enums_dataset}.{enum_name} WHERE id = {curr_enum_id} AND {extra_column} = {extra_value}")

                    is_failed = query_job.exception(timeout=None)

                    if is_failed:
                        lgr.error(
                            f"failed to delete incorrect enum for {enum_name}: event_sub_type: {curr_enum_id}, event_type: {extra_value}: {existing_enum_ids[(curr_enum_id, extra_value)]}")
                    else:
                        lgr.info(
                            f"deleted from event_sub_type: {curr_enum_id}, event_type: {extra_value}: {existing_enum_ids[(curr_enum_id, extra_value)]} from {enum_name}")

                # Check enum entry doesn't already exists
                if (curr_enum_id, extra_value) not in existing_enum_ids:
                    if extra_column is not None and extra_value is not None:
                        row_data = {
                            "id": curr_enum_id,
                            "value": display_value,
                            extra_column: extra_value
                        }
                    else:
                        row_data = {
                            "id": curr_enum_id,
                            "value": display_value
                        }
                    rows.append(row_data)
                # Adding this check as a fix due to dependant enum values not inserted in the correct format (XDR-29898)
                elif (curr_enum_id, extra_value) in existing_enum_ids and existing_enum_ids[(curr_enum_id, extra_value)] != display_value:
                    update_rows[(curr_enum_id, extra_value)] = display_value

            if not rows:
                lgr.info(f"no rows to insert into {enum_table.table_id}")
            else:
                lgr.info(f"inserting {len(rows)} into {enum_table.table_id}")
                lgr.debug(f"row data {rows}")
                insert_res = bq_dao.insert_rows(rows, enum_table)
                lgr.info(f"inserted {len(rows)} into {enum_table.table_id}")
                lgr.debug(f"got response: {insert_res}")

            # Updating rows (XDR-29898)
            if not update_rows:
                lgr.info(f"no rows to update in {enum_table.table_id}")
            else:
                lgr.info(f"updating {len(update_rows)} for {enum_table.table_id}")
                lgr.debug(f"update data {update_rows}")
                update_sql = []
                is_failed = True
                retry_count = 0
                while is_failed is True and retry_count < 5:
                    for update_ids, update_value in update_rows.items():
                        sql = f"""UPDATE {config.GCPConf.bq_enums_dataset}.{enum_name} 
                                  SET VALUE = '{update_value}' 
                                  WHERE id = {update_ids[0] if not isinstance(update_ids[0], str) else f"'{update_ids[0]}'"} {f'AND {extra_column} = {update_ids[1]}' if update_ids[1] else ''} """
                        update_sql.append(sql)
                    query_job = bq_dao.client.query(";\n".join(update_sql))
                    try:
                        is_failed = query_job.exception(timeout=None)
                    except Exception:
                        lgr.warning("exception is ", exc_info=1)
                        is_failed = True
                    if is_failed:
                        lgr.error(f"failed to update enums. got: {is_failed}")
                        retry_count += 1
                        time.sleep(5)
                        continue
                    lgr.info(f"updated {len(rows)} for {enum_table.table_id}")
                    is_failed = False

                if is_failed:
                    is_succeed = False

    if is_succeed:
        lgr.info("BQ Enum update succeed, updating redis watermark.")
        redis.set(redis_key, _hash)
    else:
        lgr.warning("BQ Enum update failed. Will be executed on next run")

