            try:

                # get current enum values
                curr_enum_vals = s2dao.execute(f"select * from {config.GCPConf.bq_enums_dataset}.{enum_name}")
                existing_enum_ids = {(x.get("id"), x.get(extra_column)): x.get("value") for x in curr_enum_vals}
                if len(curr_enum_vals) != len(enum_data.values()):
                    recreate = True
                    lgr.warning("recreating table %s", enum_name)
                tb_schema = s2dao.execute("""select COLUMN_NAME, COLUMN_TYPE  from INFORMATION_SCHEMA.COLUMNS
                                                    where TABLE_NAME = %(table_name)s """, {"table_name": enum_name})
                for f in tb_schema:

                    if f['COLUMN_NAME'] == "id" and (
                            (f['COLUMN_TYPE'] == "text" and is_numeric_values is True) or (f['COLUMN_TYPE'] == "bigint(20)" and is_numeric_values is False)):
                        lgr.warning("enum schema changed dropping %s", enum_name)
                        recreate = True
                        break
                if len(enum_data.values()) == 0:
                    recreate = True  # empty, we can't tell type anymore
            except Exception as e:
                if f"Table '{config.GCPConf.bq_enums_dataset}.{enum_name}' doesn't exist" in str(e):
                    recreate = True
                else:
                    lgr.exception("error in enum read")
                    raise
            if recreate is True and len(enum_data.values()) > 0:
                lgr.info(f"enum table {enum_name} not found. Creating")
                try:
                    s2dao.execute(f"DROP TABLE IF EXISTS {config.GCPConf.bq_enums_dataset}.{enum_name};", fetch=False, commit=True)
                except:
                    pass
                # Create missing enum table
                existing_enum_ids = None
                enum_schema = [
                    {
                        "name": "id",
                        "type": id_type,
                    },
                    {
                        "name": "value",
                        "type": "text",
                    }
                ]
                if extra_column is not None:
                    enum_schema.append(
                        {
                            "name": extra_column,
                            "type": id_type,
                        }
                    )

                s2dao.execute(
                    f"CREATE REFERENCE TABLE {config.GCPConf.bq_enums_dataset}.{enum_name} ({','.join('%s %s' % (x['name'], x['type']) for x in enum_schema)})",
                    fetch=False, commit=True)
                lgr.info(f"enum table {enum_name} created")

            # get current enum values
            if existing_enum_ids is None:
                curr_enum_vals = s2dao.execute(f"SELECT * FROM {config.GCPConf.bq_enums_dataset}.{enum_name}")
                existing_enum_ids = {(x.get("id"), x.get(extra_column)): x.get("value") for x in curr_enum_vals}

            for enum_value in enum_data.values():
                extra_value = None

                display_value = enum_value.get('display')

                if extra_column is not None:
                    dep = enum_value.get("dependency")
                    dep_field = dep.get("field")
                    dep_value = dep.get("ref").upper()
                    extra_value = get_enums()['datasets']['xdr_data'][dep_field][dep_value]['value']
                    display_value = dep_value + '_' + display_value

                curr_enum_id = enum_value.get('value')

                # Fixing bug where enums file contained event_type LOAD_IMAGE (6), sub type PRELOAD as type 2 instead of 3 (XDR-29898)
                if enum_name == "event_sub_type" and (curr_enum_id, extra_value) == (2, 6) and existing_enum_ids.get((curr_enum_id, extra_value)) in (
                'PRELOAD', 'LOAD_IMAGE_PRELOAD'):
                    existing_enum_ids.pop((curr_enum_id, extra_value), None)
                    s2dao.execute(f"DELETE FROM {config.GCPConf.bq_enums_dataset}.{enum_name} WHERE id = {curr_enum_id} AND {extra_column} = {extra_value}",
                                  fetch=False, commit=True)

                # Check enum entry doesn't already exists
                if (curr_enum_id, extra_value) not in existing_enum_ids:
                    if extra_column is not None and extra_value is not None:
                        row_data = {
                            "id": curr_enum_id,
                            "value": display_value,
                            extra_column: extra_value
                        }
                    else:
                        row_data = {
                            "id": curr_enum_id,
                            "value": display_value
                        }
                    rows.append(row_data)
                # Adding this check as a fix due to dependant enum values not inserted in the correct format (XDR-29898)
                elif (curr_enum_id, extra_value) in existing_enum_ids and existing_enum_ids[(curr_enum_id, extra_value)] != display_value:
                    update_rows[(curr_enum_id, extra_value)] = display_value

            if not rows:
                lgr.info(f"no rows to insert into {enum_name}")
            else:
                lgr.info(f"inserting {len(rows)} into {enum_name}")
                lgr.debug(f"row data {rows}")
                insert_res = s2dao.upsert_mult(rows, f"{config.GCPConf.bq_enums_dataset}.{enum_name}")
                lgr.info(f"inserted {len(rows)} into {enum_name}")
                lgr.debug(f"got response: {insert_res}")

            # Updating rows (XDR-29898)
            if not update_rows:
                lgr.info(f"no rows to update in {enum_name}")
            else:
                lgr.info(f"updating {len(update_rows)} for {enum_name}")
                lgr.debug(f"update data {update_rows}")
                update_sql = []
                for update_ids, update_value in update_rows.items():
                    sql = f"""UPDATE {config.GCPConf.bq_enums_dataset}.{enum_name} 
                              SET VALUE = '{update_value}' 
                              WHERE id = {update_ids[0] if not isinstance(update_ids[0], str) else f"'{update_ids[0]}'"} {f'AND {extra_column} = {update_ids[1]}' if update_ids[1] else ''} """
                    update_sql.append(sql)
                s2dao.execute(";\n".join(update_sql), fetch=False, commit=True)

