def validate_by_fields(fields: list, metadata: HelperMetadata, supports_float: bool = True) -> None:
    for field_name in fields:
        f = metadata.schema.get(field_name)
        if not f:
            raise FieldNotFoundValidationError("unknown field {param_name}.",
                                               param_name=field_name)
        if is_array(f):
            if config.InvestigationConf.xql_arrays_fields_validation:
                raise ValidationError("Aggregation by {param_name} field of type array is unsupported.",
                                      param_name=field_name)
            else:
                lgr.warning(f"Aggregation by {field_name} field of type array is unsupported.")

        if not supports_float and f.supports_type(FieldDType.NUMERIC_FLOAT):
            raise ValidationError("Aggregation by {param_name} field of type float is unsupported.",
                                      param_name=field_name)

        if field_name in SchemaHelper.JSON_TYPE_FIELDS.get(metadata.table, []):
            if config.InvestigationConf.xql_arrays_fields_validation:
                raise ValidationError("Aggregation by {param_name} field of type JSON is unsupported.",
                                      param_name=field_name)
            else:
                lgr.warning(f"Aggregation by {field_name} field of type JSON is unsupported.")

