def convert_raw_sql_part(sql_raw_part, sql):
    result_sql = ""
    for sql_stage in (sql_raw_part[0].get(SqlStage.STAGES) or []):
        if sql_stage.get(SqlStage.NEXT_STAGE):
            if sql_stage[SqlStage.NEXT_STAGE] not in sql_stage[SqlStage.SQL]:
                raise ValueError(f" Raw sql: {sql_stage[SqlStage.SQL]} doesn't contains part to replace:"
                                 f" {sql_stage[SqlStage.NEXT_STAGE]}")
            result_sql = sql_stage[SqlStage.SQL].replace(f"<%{sql_stage[SqlStage.NEXT_STAGE]}%>", result_sql)
        else:
            result_sql = result_sql + sql_stage[SqlStage.SQL]

    if sql_raw_part[0].get(SqlStage.APPEND, True) is True:
        return f""" {sql} {result_sql} """
    else:
        return result_sql.format(inner_clause=sql)

