def _define_out_fields(stage: dict):
    top_count = stage.get(_T.TOP_COUNT)
    top_percent = stage.get(_T.TOP_PERCENT)
    show_count = top_count is not None
    show_percent = top_percent is not None

    if not (show_count or show_percent):
        # Neither were specified - we'll use both with default names
        show_count = show_percent = True

    if top_count is None:
        top_count = _T.TOP_COUNT
    if top_percent is None:
        top_percent = _T.TOP_PERCENT
    return top_count, top_percent, show_count, show_percent

