def get_frame_info(stage_info, sort_fields: list, metadata: HelperMetadata) -> str | None:
    # -num == preceding
    # num == following

    frame = stage_info.get(XQLConsts.Windowcomp.FRAME)
    if not frame:
        return

    start = frame[XQLConsts.Windowcomp.START]
    end = None
    end_exist = frame.get(XQLConsts.Windowcomp.END_EXIST, False)
    rows_range = frame.get(XQLConsts.Windowcomp.ROWS_RANGE)

    res = f'{"ROWS" if not rows_range else rows_range.upper()} {"BETWEEN " if end_exist else ""}'
    if start is None:
        res += "UNBOUNDED PRECEDING"
    elif isinstance(start, int):
        if start == 0:
            res += "CURRENT ROW"
        else:
            res += f'{abs(start)} {"FOLLOWING" if start > 0 else "PRECEDING"}'
    else:
        raise ValidationError("{param_name} start frame param can only be configured as an integer or null value", param_name=start)

    if end_exist:
        end = frame[XQLConsts.Windowcomp.END]
        res = f"{res} AND "

        if end is None:
            res += "UNBOUNDED FOLLOWING"
        elif isinstance(end, int):
            if end == 0:
                res += "CURRENT ROW"
                if isinstance(start, int) and start > 0:
                    raise ValidationError("The second parameter in the range must be bigger than the first parameter.")
            else:
                if end < 0 and isinstance(start, int) and (start == 0 or start > 0):
                    # start - current_row && end - numeric_preceding
                    # start - numeric_following && end - numeric_preceding
                    raise ValidationError("Second parameter in the range must be bigger than the first parameter.")
                res += f'{abs(end)} {"FOLLOWING" if end > 0 else "PRECEDING"}'
        else:
            raise ValidationError("{param_name} end frame param can only be configured as an integer or null value", param_name=end)
    else:
        # If only start - it should be only numeric_preceding and not numeric_following
        # - so it can be only negative number
        if isinstance(start, int) and start > 0:
            raise ValidationError("{param_name} start frame param on it's own can only be configured "
                                  "as a negative integer", param_name=str(start))

    if (start or end) and rows_range and rows_range.casefold() == XQLConsts.Windowcomp.RANGE:
        # start or end are not null and not 0 - OFFSET PRECEDING or OFFSET FOLLOWING
        if len(sort_fields) != 1:
            raise ValidationError("Using RANGE with start or end numeric non zero boundaries "
                                  "requires using exactly one sort field.")
        field_name = sort_fields[0][XQLConsts.SortStage.SORT_FIELD]
        field = metadata.schema.get(field_name)
        if not field.supports_type(FieldDType.NUMERIC):
            raise ValidationError("Using RANGE with start or end numeric non zero boundaries "
                                  "requires using numeric type sort field.")

    return res

